import React from 'react';
// ../ means current folder state move to one level up (here 2 level up) 
import logo from '../../images/logo.png';
// ./ means same folder state
import './Header.css';


const Header = () => {
    return (
        <div className='header'>
            <img src={logo} alt="" />
            <nav>
                <ul>
                    <li></li>
                    <li></li>
                    <li></li>
                </ul>
            </nav>
        </div>
    );
};

export default Header;
